<script lang="ts">
export default {
  name: 'SetupPage',
};
</script>


<script setup lang="ts">
import {routerPush} from '~/popup/router'
import {api, isFetchError} from '~/services'
import {useUserStore} from '~/store/user'
import {useWalletsStore} from '~/store/wallet'
import {reactive, ref} from 'vue'
import setAuthorizationToken from '~/plugins/set-authorization-token'
import {ConsensusState} from "~/types/users";
import {generateSeed, generateAddresses} from '~/sia/index.js';
import {hash} from 'tweetnacl';
import {encode as encodeUTF8} from '@stablelib/utf8';
import {saveAddresses} from '~/store/db.js';
import {storeToRefs} from "pinia";
import {canCreateUser} from "~/services/backend";
import useClipboard from "~/composables/useClipboard";
interface LoginUser {
  confirmPassword: string;
  passwordsMatch: boolean;
  unlockPassword: string;
}

const {toClipboard} = useClipboard()

const formRef = ref<HTMLFormElement | null>(null)
const form: LoginUser = reactive({
  unlockPassword: '',
  confirmPassword: '',
  passwordsMatch: true,
})

const step = ref('password'), createType = ref('create'),
    walletName = ref(''),
    recoverySeed = ref(''),
    currencyType = ref('sc'),
    seedType = ref('sia'),
    serverType = ref('siacentral'), creating = ref(false), saving = ref(false), exported = ref(false);

let wallet = reactive({
  id: '',
  seed: '',
  title: '',
  currency: '',
  type: '',
  server_type: '',
  server_url: null
})

const userStore = useUserStore();
const store = useWalletsStore()
const {pushNotification, getSetupStep, lockWallets, createWallet, deleteWallet, queueWallet, setSetup} = store

const {user} = storeToRefs(userStore)
const {setupMode} = storeToRefs(store)
const {updateUser, userLogout} = userStore;

let addresses = []


const enableNext = computed(() => {
  return form.unlockPassword.length > 0 && form.unlockPassword === form.confirmPassword;
})

const walletType = computed(() => {
  return wallet && typeof wallet.type === 'string' ? wallet.type : 'watch';
})

const doneDisabled = computed(() => {
  // disable the done button if the wallet is being saved, or has not been exported
  return saving.value || (!exported.value && walletType.value === 'default');
})


const onCheckPassword = () => {
  try {
    form.passwordsMatch = form.confirmPassword === form.unlockPassword;
  } catch (ex) {
    console.error('onCheckPassword', ex);
  }
}

const onSetPassword = () => {
  try {
    if (form.unlockPassword.length === 0 || form.unlockPassword !== form.confirmPassword)
      return;

    updateUser({unlockPassword: hash(encodeUTF8(form.unlockPassword))})
    // this.step = 1;
    if (setupMode.value === 'forgot-password') {
      onClickWalletType('recover')
    } else if (setupMode.value === 'create-new') {
      onClickWalletType('create')
    } else {
      step.value = 'choose';
    }
  } catch (ex) {
    console.error('onSetPassword', ex);
    pushNotification({
      severity: 'danger',
      icon: 'wallet',
      message: ex.message
    });
  }
}

const onClickWalletType = (type: string) => {
  try {
    if (setupMode.value === 'create-new') {
      createType.value = type;
      onCreateWallet();
    } else if (setupMode.value === 'forgot-password') {
      step.value = 'create';
    } else if (type === 'recover') {
      step.value = 'create';
    } else {
      createType.value = type;
      onCreateWallet();
    }
    createType.value = type;
  } catch (ex) {
    console.error('onClickWalletType', ex);
    pushNotification({
      message: ex.message,
      severity: 'danger'
    });
  }
}

const generateWalletSeed = async () => {
  let seed;

  switch (createType.value) {
    case 'recover':
      await generateAddresses(unref(recoverySeed), unref(currencyType), 0, 1);
      seed = recoverySeed;
      break;
    default:
      seed = await generateSeed(unref(seedType));
      await generateAddresses(unref(seed), unref(currencyType), 0, 1);
      break;
  }

  return seed;
}

const onCreateWallet = async () => {
  if (creating.value)
    return;

  creating.value = true;

  try {
    const seed = await generateWalletSeed();
    if (getSetupStep() !== 'error') {
      wallet = {
        seed: unref(seed),
        title: unref(walletName),
        currency: unref(currencyType),
        type: 'default',
        server_type: unref(serverType),
        server_url: null
      };
      console.log(wallet);

      if (await saveWallet()) {
        if (setupMode.value === 'forgot-password') {
          onWalletCreated();
        } else {
          step.value = 'review';
        }
      }
    }
  } catch (ex) {
    console.error('onCreateWallet', ex);
    pushNotification({
      severity: 'danger',
      message: ex.message
    });
  } finally {
    creating.value = false;
  }
}

const saveWallet = async () => {
  const {user} = useUserStore()
  if (saving.value)
    return;

  saving.value = true;

  try {
    const walletID = await createWallet(wallet, user?.unlockPassword);

    wallet.id = walletID;

    const canCreate = await canCreateUser(walletID, user?.unlockPassword)

    if (canCreate) {
      addresses = await generateAddresses(wallet.seed, wallet.currency, 0, 10);

      if (addresses) {
        await saveAddresses(addresses.map(a => ({
          ...a,
          wallet_id: walletID
        })));

        queueWallet(wallet.id, true);
      }
    } else {
      await deleteWallet(walletID);
      logout();
      form.confirmPassword = '';
      form.unlockPassword = '';
      step.value = 'password';
      pushNotification({
        message: 'Cannot create wallet, please make sure you have the correct password',
        severity: 'danger'
      });
      return false;
    }
    return true;
  } catch (ex) {
    console.error('saveWallet', ex);
    pushNotification({
      message: ex.message,
      severity: 'danger'
    });
  } finally {
    saving.value = false;
  }
}

const onWalletCreated = async () => {
  try {
    setSetup(true);

    await routerPush('wallets')
  } catch (ex) {
    console.error('onWalletCreated', ex);
    pushNotification({
      severity: 'danger',
      icon: 'wallet',
      message: ex.message
    });
  }
}

const caption = computed(() => {
  switch (setupMode.value) {
    case 'default':
    case 'create-new':
      return 'Get Started';
    case 'forgot-password':
      return 'Reset password';
    default:
      return '';
  }
})

const captionRecover = computed(() => {
  switch (setupMode.value) {
    case 'forgot-password':
      return 'Reset password';
    default:
      return 'Recover';
  }
})

const description = computed(() => {
  switch (setupMode.value) {
    case 'default':
    case 'create-new':
      return 'Set a secure password to encrypt your wallets with. This password will be required to unlock, create, and recover your wallets. All wallet seeds are encrypted, stored locally and never leave the device.';
    case 'forgot-password':
      return 'Please, enter your new password. On the next step you will need your wallet seed to restore access to your Tiri data wallet';
    default:
      return '';
  }
})

const stepBackward = async ()  => {
  switch (step.value) {
    case 'choose':
      step.value = 'password';
      break;
    case 'create':
      step.value = 'choose';
      break;
    case 'review':
      if (wallet.id) {
        await deleteWallet(wallet.id);
      }
      step.value = 'choose';
      break;
  }
}

const logout = async () => {
  await userLogout();
}

const copyToClipboard = async () => {
  try {
    await toClipboard(wallet.seed)

    pushNotification({
      message: 'Recovery seed copied',
      icon: 'wallet'
    })
  } catch (e) {
    console.error(e)
  }
}

</script>

